import React, { Component } from 'react';

class Deets extends Component {
    renderPup = () => {
        if (this.props.bestBoy !== null) {
            return <img src={this.props.bestBoy.image} />
        }
    }        


    render() {
        return (
            <div>
                {this.renderPup}
            </div>
        );
    }
}

export default Deets;
